import './app.css';

import Login from './Login';
import LoggedInNavbar from './LoggedInNavbar';
import TopTracks from './pages/TopTracks';
import TopArtists from './pages/TopArtists';
import useAuth from './useAuth';

import { Router, Route, Routes } from 'react-router-dom';

const code = new URLSearchParams(window.location.search).get("code");

function App() {

  const accessToken = useAuth(code);

  return (
    <div>
      {code ? <LoggedInNavbar code={code} /> : <Login />}
      <Routes>
        <Route path="/" element={<div>Hi</div>} ></Route>
        <Route path="/top-tracks" element={<TopTracks accessToken={accessToken} />} ></Route>
        <Route path="/top-artists" element={<TopArtists accessToken={accessToken} />} ></Route>
      </Routes>
    </div>
  )

}

export default App;
